import './Profile.css';
import { Navbar } from '../../components';
import { UseToken } from '../../hooks';

export default function Profile() {
    const [token, setToken] = UseToken();

  return (
        <main className='page'>
            <header className='header'>
                <Navbar />
            </header>
            <div>this is token: { token }</div>
        </main>
  );
}
